import {Container} from "@material-ui/core";
import React from "react";
import { NavLink } from "react-router-dom";
import styles from "./style";
import './Dashboard.css';

export default function BuyerDashboard() {
  const classes = styles();
  return (
    <div>
      <ul>
        <li><NavLink to="/buyer/component/follower">Follower</NavLink></li>
        <li><NavLink to="/buyer/component/product">Product</NavLink></li>
        <li><NavLink to="/buyer/component/cart">Cart</NavLink></li>
        <li><NavLink to="/buyer/component/order">Order</NavLink></li>
      </ul>
      <Switch>
          {/* By using Switch component we're only getting one route rendered at a time */}
          <Route path="/" component={Home} exact />
          <Route path="/dashboard" component={Dashboard} />
          <Route path="/about-me" component={About} />
          <Route path="/routing-example" component={ReduxRoutingExample} />
        </Switch>
    </div>
  );
}
